import playv from "./video/banner.webm";

const Home = () => {
    return ( 
        <div>
        <div className="flex justify-center relative mt-1">
            <video className="object-cover w-full h-64 sm:h-96" autoPlay loop muted>
                <source src={playv} type="video/webm"/>
            </video>
            <div className="absolute top-24 right-24 text-right">
            
            <h1 className="mt-7 font-primary2 text-3xl sm:text-4xl text-white opacity-100">BUILT TO BE BOLD</h1>
            <br />
            <p className="text-white font-primary4">Which classic from the ZX 8000 "Blackpink" collection </p>
            <p className="text-white font-primary4">gets you in the mood to play?</p>
            <br />
            <div className="pl-96"><p className="px-5 py-2 rounded-full cursor-pointer tracking-wide font-primary2 bg-white">SHOP NOW</p></div>
            
            </div>
            
        </div>
        <p  className="m-7 font-primary2 text-center text-3xl sm:text-3xl text-black">SHOP BY BRAND</p>
        <div className="flex grid grid-cols-6 h-96 ">
            <img className="h-96 object-cover cursor-pointer" src="pics/CTS_MULTI_TEE_GP4306_21_model.jpg" alt="" />
        
            <img className="h-96 object-cover" src="pics\f631a2b1756045f79a9dbd5ca4fd2494.webp" alt="" />
        </div>
        
        </div>
     );
}
 
export default Home;
